Themes:Â African American, #Reconstruction, #Democracy & #Citizenship, #Racism & #RacialIdentity

TheÂ #ReconstructioneraÂ #ClintonMassacre began on Sept. 4, 1875, in the small town of #ClintonMississippiÂ at aÂ #RepublicanÂ rally to introduce the partyâ€™s candidates who were running for political office in the upcoming #Novemberelections. The immediate death toll included five African American and three white men. Over the next several days, an estimated #fifty African Americans were killed.
Over 1,500 #blackRepublicans and their families gathered on the grounds of the former #MossHillplantation for a barbecue and #politicalrally. Approximately 100 whites also attended, including a fewÂ #DemocratsÂ from the nearby town of Raymond.

While a Republican was giving a speech, shots were fired. When the gunfire ended, a total of five African Americans, including two children, and three white people were dead, and nearly thirty others were wounded.
The following days were marked by violence and bloodshed as the white mob indiscriminately shot and killed nearly fifty African Americans in Clinton and the surrounding area. In addition, the white mob murdered a white school teacher working in the African American community.
Although Governor Ames requested federal troops to assist in restoring order, President #UlyssesGrant denied the request on September 14 and adopted a policy of non-intervention, leaving Ames and the local Black and white Republicans without protection.
Description above fromÂ Blackpast.orgÂ byÂ Sheren Sanders,Â #AlcornStateUniversity.
